import { createRouter, createWebHashHistory } from 'vue-router'
import Layout from '@/layout/index.vue'
import Login from '../views/Login.vue'
import Register from '../views/Register.vue'
import Home from '../views/Home.vue'
import UserManage from '../views/UserManage.vue'
import Profile from '../views/Profile.vue'
import SystemSettings from '../views/SystemSettings.vue'
import RoleManage from '../views/RoleManage.vue'
import OperationLog from '../views/OperationLog.vue'
import LoginLog from '../views/LoginLog.vue'
import SupplierManage from '../views/SupplierManage.vue'
import CustomerManage from '../views/CustomerManage.vue'

const routes = [
  {
    path: '/',
    redirect: '/dashboard'
  },
  {
    path: '/login',
    name: 'Login',
    component: Login
  },
  {
    path: '/register',
    name: 'Register',
    component: Register
  },
  {
    path: '/dashboard',
    component: Layout,
    children: [
      {
        path: '',
        name: 'Home',
        component: Home,
        meta: { title: '首页', icon: 'House' }
      },
      {
        path: 'users',
        name: 'UserManage',
        component: UserManage,
        meta: { title: '用户管理', icon: 'User' }
      },
      {
        path: 'roles',
        name: 'RoleManage',
        component: RoleManage,
        meta: { title: '角色管理', icon: 'Lock' }
      },
      {
        path: 'profile',
        name: 'Profile',
        component: Profile,
        meta: { title: '个人中心', icon: 'UserFilled' }
      },
      {
        path: 'settings',
        name: 'SystemSettings',
        component: SystemSettings,
        meta: { title: '系统设置', icon: 'Setting' }
      },
      {
        path: 'operation-log',
        name: 'OperationLog',
        component: OperationLog,
        meta: { title: '操作日志', icon: 'List' }
      },
      {
        path: 'login-log',
        name: 'LoginLog',
        component: LoginLog,
        meta: { title: '登录日志', icon: 'Timer' }
      },
      {
        path: 'suppliers',
        name: 'SupplierManage',
        component: SupplierManage,
        meta: { title: '供应商管理', icon: 'Shop' }
      },
      {
        path: 'customers',
        name: 'CustomerManage',
        component: CustomerManage,
        meta: { title: '客户管理', icon: 'Service' }
      }
    ]
  }
]

const router = createRouter({
  history: createWebHashHistory(),
  routes
})

export default router
